import {useAuth} from '../utils/auth';
import { Navigate } from 'react-router-dom';
export const RequireAuth = ({children}) =>
{
    const auth = useAuth()

    if (!auth.user)
    {
        return <Navigate to="/login" />;
    }

    return children;

    
}
